import styled from "styled-components";
import React from "react";
import ReactDOM from "react-dom";
import Company from "./Company";
Sc_div = styled.div`
  display: flex;
`;

function Foods(props) {
  const { data } = props;
  return (
    <Sc_div className="foods">
      {data.map((items) => (
        <Company company={items} />
      ))}
    </Sc_div>
  );
}

export default Foods;
